import React, { useState } from 'react';

function App() {
    const [insertKey, setInsertKey] = useState('');
    const [insertValue, setInsertValue] = useState('');
    const [deleteKey, setDeleteKey] = useState('');
    const [searchKey, setSearchKey] = useState('');
    const [searchResult, setSearchResult] = useState(null);
    const [notification, setNotification] = useState('');

    const handleInsert = async (e) => {
        e.preventDefault();
        if (!insertKey || !insertValue) {
            setNotification('Key and Value must be provided for insertion.');
            return;
        }

        const response = await fetch('http://127.0.0.1:5000/extendible/insert', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ key: parseInt(insertKey), value: insertValue }),
        });

        if (response.ok) {
            setNotification(`Inserted (${insertKey}, ${insertValue}) successfully!`);
            setInsertKey('');
            setInsertValue('');
        } else {
            const errorData = await response.json();
            setNotification(errorData.error);
        }
    };

    const handleDelete = async (e) => {
        e.preventDefault();
        if (!deleteKey) {
            setNotification('Key must be provided for deletion.');
            return;
        }

        const response = await fetch('http://127.0.0.1:5000/extendible/delete', {
            method: 'DELETE',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ key: parseInt(deleteKey) }),
        });

        if (response.ok) {
            setNotification(`Deleted key ${deleteKey} successfully!`);
            setDeleteKey('');
        } else {
            const errorData = await response.json();
            setNotification(errorData.error);
        }
    };

    const handleSearch = async (e) => {
        e.preventDefault();
        if (!searchKey) {
            setNotification('Key must be provided for search.');
            return;
        }

        const response = await fetch(`http://127.0.0.1:5000/extendible/search?key=${searchKey}`);
        if (response.ok) {
            const data = await response.json();
            setSearchResult(data.message);
            setNotification(`Found key ${searchKey}: ${data.message}`);
            setSearchKey('');
        } else {
            const errorData = await response.json();
            setSearchResult(null);
            setNotification(errorData.error);
        }
    };

    return (
        <div className="App">
            <h1>Hashing</h1>

            <h2>Insert</h2>
            <form onSubmit={handleInsert}>
                <input
                    type="number"
                    placeholder="Key"
                    value={insertKey}
                    onChange={(e) => setInsertKey(e.target.value)}
                />
                <input
                    type="text"
                    placeholder="Value"
                    value={insertValue}
                    onChange={(e) => setInsertValue(e.target.value)}
                />
                <button type="submit">Insert</button>
            </form>

            <h2>Delete</h2>
            <form onSubmit={handleDelete}>
                <input
                    type="number"
                    placeholder="Key"
                    value={deleteKey}
                    onChange={(e) => setDeleteKey(e.target.value)}
                />
                <button type="submit">Delete</button>
            </form>

            <h2>Search</h2>
            <form onSubmit={handleSearch}>
                <input
                    type="number"
                    placeholder="Key"
                    value={searchKey}
                    onChange={(e) => setSearchKey(e.target.value)}
                />
                <button type="submit">Search</button>
            </form>

            {notification && <div className="notification">{notification}</div>}
            {searchResult && <div className="search-result">{searchResult}</div>}
        </div>
    );
}

export default App;
